import React from 'react';

const Navbar = () => {
    return(
        <nav className="new-wrapper blue light-3">
            <div className="center">
                <a className="brand-logo">Live Hashtag Event</a>
                <ul className="right">
                    <li><a href="/">Home</a> </li>
                </ul>
            </div>
        </nav>
    )
}
export default Navbar
